‘Yes’ – Indicates individual DOES NOT have any health insurance;
‘No’ – Indicates individual has at least one type of health insurance;
‘Unknown’ – Indicates that it is not known whether individual has health insurance.

‘Yes’ – Indicates individual DOES NOT have a chronic medical condition;
‘No’ – Indicates individual has at least one chronic medical condition;
‘Unknown’ – Indicates that it is not known whether individual has a chronic medical condition.

The type of vehicle.
BOAT = Boat;
SNOW = Snowmobile;
TRL = Trailer;
VEH = All other vehicles

Approved – A permit has been issued;
Pending/Tentative – Application is in good standing;
Stage Denied – One segment of the application is denied (e.g., failure to submit fees/documents).  The application is considered denied.  There will be no further communication with the organizer unless fees/insurance/documents are submitted at which time the application is eligible to be returned to Pending/Tentative/Approved status;
Denied – Applicant did not meet requirements and the proposed event is not permitted to occur;
Cancelled – Applicant notified Chicago Park District they do not intend to have the event
